[include mainsail.cfg]
[include macros.cfg]
[include KAMP_Settings.cfg]
[include config_backup.cfg]
[virtual_sdcard]
path: /home/voron/printer_data/gcodes
on_error_gcode: CANCEL_PRINT
[display_status]
[respond]
[pause_resume]
[exclude_object]

[force_move]
enable_force_move: true

[mcu]
canbus_uuid: 40ea2ff76398
[mcu EBBCan]
canbus_uuid: 70ce26c2a241

[printer]
kinematics: corexy
max_velocity: 800  
max_accel: 8000
max_z_velocity: 30
max_z_accel: 500
square_corner_velocity: 20

[temperature_sensor MCU]
sensor_type: temperature_mcu

[temperature_sensor SoC]
sensor_type: temperature_host

#####################################################################
## 	                       X/Y Step Motors                         ##
#####################################################################

## X Stepper on Motor1 (B Motor)
[stepper_x]
step_pin: PE6
dir_pin: PE5
enable_pin: !PC14
microsteps: 32
rotation_distance: 40
full_steps_per_rotation:200
endstop_pin: EBBCan:gpio24
position_endstop: 350
position_min: 0
position_max: 350
homing_speed: 100
homing_retract_dist: 5
homing_positive_dir: true

## Y Stepper on Motor2 (A Motor)
[stepper_y]
step_pin: PE2
dir_pin: PE1
enable_pin: !PE4
microsteps: 32
rotation_distance: 40
endstop_pin: ^PF3
full_steps_per_rotation:200
position_endstop: 350
position_min: 0
position_max: 350
homing_speed: 100
homing_retract_dist: 5

#####################################################################
## 	                        Z Step Motors                          ##
#####################################################################

## Z0 Stepper - Front Left on MOTOR3
[stepper_z]
step_pin: PB8
dir_pin: PB7
enable_pin: !PE0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32
endstop_pin: probe:z_virtual_endstop
position_max: 280
position_min: -1
homing_speed: 8
second_homing_speed: 3
homing_retract_dist: 0

##	Z1 Stepper - Rear Left on Motor4
[stepper_z1]
step_pin: PB4
dir_pin: !PB3
enable_pin: !PB6
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

##	Z2 Stepper - Rear Right on Motor5
[stepper_z2]
step_pin: PG13
dir_pin: PG12
enable_pin: !PG15
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

##	Z3 Stepper - Front Right on Motor6
[stepper_z3]
step_pin: PG9
dir_pin: !PD7
enable_pin: !PG11
rotation_distance: 40
gear_ratio: 80:16
microsteps: 32

#####################################################################
## 	                      Stepper Drivers                          ##
#####################################################################

[tmc2209 stepper_x]
uart_pin: PC13
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 stepper_y]
uart_pin: PE3
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 stepper_z]
uart_pin: PB9
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 stepper_z1]
uart_pin: PB5
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 stepper_z2]
uart_pin: PG14
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 stepper_z3]
uart_pin: PG10
run_current: 0.8
hold_current: 0.5
interpolate: true

[tmc2209 extruder]
uart_pin: EBBCan:gpio20
run_current: 0.8
hold_current: 0.5
interpolate: true

#####################################################################
## 	                     TMC Autotune Settings                      ##
#####################################################################

[motor_constants MS17HD6P4201-04]
resistance: 1.3
inductance: 0.0027
holding_torque: 0.67
max_current: 2.0
steps_per_revolution: 200

[motor_constants moons-nema14-pancake]
resistance: 1.9
inductance: 0.0014
holding_torque: 0.1
max_current: 1.0
steps_per_revolution: 200

[autotune_tmc stepper_x]
motor: MS17HD6P4201-04
tuning_goal: performance

[autotune_tmc stepper_y]
motor: MS17HD6P4201-04
tuning_goal: performance

[autotune_tmc stepper_z]
motor: MS17HD6P4201-04
tuning_goal: silent

[autotune_tmc stepper_z1]
motor: MS17HD6P4201-04
tuning_goal: silent

[autotune_tmc stepper_z2]
motor: MS17HD6P4201-04
tuning_goal: silent

[autotune_tmc stepper_z3]
motor: MS17HD6P4201-04
tuning_goal: silent

[autotune_tmc extruder]
motor: moons-nema14-pancake
tuning_goal: performance

#####################################################################
## 	                          Extruder                             ##
#####################################################################

[extruder]
step_pin: EBBCan:gpio18
dir_pin: EBBCan:gpio19
enable_pin: !EBBCan:gpio17
rotation_distance: 21.498
gear_ratio: 50:10
microsteps: 64
full_steps_per_rotation: 200
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: EBBCan:gpio7
#control: pid
#pid_Kp: 21.527
#pid_Ki: 1.063
#pid_Kd: 108.982
min_extrude_temp: 170
min_temp: 0
max_temp: 320
max_power: 1.0
sensor_type: MAX31865
sensor_pin: EBBCan:gpio9
spi_software_sclk_pin: EBBCan:gpio10
spi_software_mosi_pin: EBBCan:gpio8
spi_software_miso_pin: EBBCan:gpio11
rtd_nominal_r: 1000
rtd_reference_r: 4300
rtd_num_of_wires: 2
max_extrude_only_distance: 200
max_extrude_cross_section: 5.0
pressure_advance_smooth_time: 0.04

[fan]
pin: EBBCan:gpio13

[heater_fan hotend_fan]
pin: EBBCan:gpio14
heater: extruder
heater_temp: 40.0

#####################################################################
## 	                           Probe                               ##
#####################################################################

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_110762BF5157355957202020FF0F113B-if00
x_offset: 0
y_offset: 20
mesh_main_direction: x
mesh_runs: 2
lift_speed: 30
z_settling_time: 200

contact_max_hotend_temperature: 180

home_xy_position: 175, 175
home_z_hop: 10
home_z_hop_speed: 30
home_xy_move_speed: 800
home_y_before_x: True
home_method: proximity
home_method_when_homed: proximity
home_autocalibrate: unhomed

#####################################################################
## 	                         Bed Heater                            ##
#####################################################################

[heater_bed]
heater_pin: PA1
sensor_type: Generic 3950
sensor_pin: PB1
max_power: 1
min_temp: 0
max_temp: 120
smooth_time: 3.0
#control: pid
#pid_kp = 41.530
#pid_ki = 1.384
#pid_kd = 311.477

#[output_pin nevermore]
#pin: XXX
#value: 0
#shutdown_value: 0

#####################################################################
## 	                         Temp Sensors                          ##
#####################################################################

[temperature_sensor chamber]
sensor_type: PT1000
sensor_pin: PB0
min_temp: 0
max_temp: 250
gcode_id: chamber

#####################################################################
## 	                             Fans                              ##
#####################################################################

#[controller_fan fan1]
#pin: PF7
#max_power: 1.0
#shutdown_speed: 0

[fan]
pin: EBBCan:gpio13

[heater_fan hotend_fan]
pin: EBBCan:gpio14
heater: extruder
heater_temp: 40.0

[fan_generic fan1]
pin: PF7
max_power: 1.0
shutdown_speed: 0

[fan_generic fan2]
pin: PF9
max_power: 1.0
shutdown_speed: 0

#[fan_generic bedfan]
#pin: PF6
#max_power: 1.0
#shutdown_speed: 0

#####################################################################
## 	                     Required Miscellaneous                    ##
#####################################################################

[bed_mesh]
speed: 200
horizontal_move_z: 2
mesh_min: 20, 20
mesh_max: 330, 335
probe_count: 40,40
fade_start: 0.5
fade_end: 2
algorithm: bicubic
zero_reference_position: 175, 175
split_delta_z: 0.025
move_check_distance: 5.0
mesh_pps: 2, 2
bicubic_tension: 0.1

[quad_gantry_level]
gantry_corners:
  -60,-10
  410,420
points:
  25, 5
  25, 305
  325, 305
  325, 5
  #25, 25
  #25, 325
  #325, 325
  #325, 25
horizontal_move_z: 10
speed: 800
retries: 15
retry_tolerance: 0.003
max_adjust: 15

[gcode_macro QUAD_GANTRY_LEVEL]
rename_existing: _QUAD_GANTRY_LEVEL
gcode:
    _QUAD_GANTRY_LEVEL horizontal_move_z=10 retry_tolerance=1
    _QUAD_GANTRY_LEVEL horizontal_move_z=3

    
#####################################################################
## 	                         Miscellaneous                         ##
#####################################################################

[input_shaper]
shaper_type_x: mzv
shaper_freq_x: 50.6
damping_ratio_x: 0.12
shaper_type_y: mzv
shaper_freq_y: 35.0
damping_ratio_y: 0.10

[adxl345]
cs_pin: EBBCan:gpio1
spi_software_sclk_pin: EBBCan:gpio2
spi_software_mosi_pin: EBBCan:gpio0
spi_software_miso_pin: EBBCan:gpio3
axes_map: z,-y,x

[resonance_tester]
accel_chip: adxl345
probe_points: 175, 175, 20
accel_per_hz: 100

[shaketune]
# result_folder: ~/printer_data/config/ShakeTune_results
# number_of_results_to_keep: 3
# keep_raw_csv: False
# show_macros_in_webui: True
timeout: 300

[firmware_retraction]
retract_length: 0.4
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 30

[gcode_arcs]
resolution: 0.1

[idle_timeout]
gcode:
    {% if not (printer.pause_resume.is_paused) %}
        RESPOND MSG="Idle timeout reached"
        TURN_OFF_HEATERS
        M84
        #halo_off
        #SET_TEMPERATURE_FAN_TARGET TEMPERATURE_FAN=hotend_fan TARGET=45
        #SET_TEMPERATURE_FAN_TARGET TEMPERATURE_FAN=chamber_heater TARGET=0

    {% endif %}
timeout: 7200

#####################################################################
## 	                             LEDS                              ##
#####################################################################

[neopixel stealthburner_leds]
pin: EBBCan:gpio16
chain_count: 3
color_order: GRBW
initial_RED: 1.0
initial_GREEN: 0
initial_BLUE: 0
initial_WHITE: 0

[delayed_gcode setdisplayneopixel]
initial_duration: 3
gcode:
    SET_LED LED=stealthburner_leds RED=1 GREEN=1 BLUE=1 WHITE=1 INDEX=1 TRANSMIT=0
    SET_LED LED=stealthburner_leds RED=1 GREEN=1 BLUE=1 WHITE=1 INDEX=2 TRANSMIT=0
    SET_LED LED=stealthburner_leds RED=1 GREEN=1 BLUE=1 WHITE=1 INDEX=3

[output_pin led_bar]
pin: PA3
pwm: True
cycle_time: 0.01
value: 1.0
shutdown_value: 0

